        // we get the DrinkType or create it
        $typeId=null;
        if(DB::table('drink_type_translations')->where('name',$bebida['TIPO DE BEBIDA'])->first()){
          $typeId=DB::table('drink_type_translations')->where('name',$bebida['TIPO DE BEBIDA'])->first()->drink_type_id;
        }else{
          echo '
          ATENCION:
          Creamos el tipo de bebida '.$bebida['TIPO DE BEBIDA'];
          $typeId=DB::table('drink_types')->insertGetId(['id'=>null]);
          foreach ($langs as $lan) {
            $my_drink_type=($drinkTypeTranslation[$bebida['TIPO DE BEBIDA']][$lan->code])?$drinkTypeTranslation[$bebida['TIPO DE BEBIDA']][$lan->code]:$bebida['TIPO DE BEBIDA'];
            DB::table('drink_type_translations')->insert([
              'drink_type_id' => $typeId,
              'language_id'   => $lan->id,
              'name'          => $bebida['TIPO DE BEBIDA'],
              'description'   => $bebida['TIPO DE BEBIDA']
            ]);
          }
        }
        if($bebida['TASCA']=='SI'){
          $drinkId=DB::table('drinks')->insertGetId([
            'drink_type_id' => $typeId,
            'image' => ($bebida['Imagen']=='')?'':$bebida['Imagen'],
            'price' => str_replace(',','.', $bebida['PRECIO'])
          ]);
          foreach($langs as $lang){
            DB::table('drink_translations')->insert([
              'language_id'=>$lang->id,
              'drink_id'=>$drinkId,
              'name'=>$bebida['Nombre de la bebida'],
              'description'=>$bebida['Nombre de la bebida']
            ]);
          }
        }
